import './App.css';
import Card from './card/card';

function App() {
  const dataList = [
    {name:"Efran", age:33},
    {name:"Tanveer", age:31},
    {name:"Tanif", age:18},
    {name:"Mehjabin", age:9}
  ];
  return (
    <div className="App">
      <Card name={dataList[0].name} age={dataList[0].age} />
      <Card name="Tanveer" age="31" />
      <Card name="Tanif" age="18" />
      <Card name="mehjabin" age="9" />
    </div>
  );
}

export default App;
